  false,\n\t\"url\": null,\n\t\"notes\": \"The management of water levels is essential
  to meet refuge objectives. These objectives are to control water levels to: (1)
  provide resting and feeding habitat for migratory waterfowl and other birds, (2)
  provide nesting habitat for local waterfowl and waterbirds, (3) provide wildlife
  observation opportunities for refuge visitors, and (4) exercise controls over the
  rate of encroachment of Purple Loosestrife. This report outlines the goals, challenges
  and results of the water management efforts at Montezuma National Wildlife Refuge
  in 1983.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
